import React from "react";
import StripeCheckout from "react-stripe-checkout";
import './bookingpopup.css';

const Bookingpopup = ({ isOpen, message, onClose, makePayment, product }) => {
	if (!isOpen) return null;

	return (
		<div className="popup-box">
			<div className="popup">
				<h2>Success Message</h2>
				<h4>{message}</h4>
				<button type="button" className="btn1" onClick={onClose}>
					OK
				</button>
				<StripeCheckout
					stripeKey="pk_test_51PJFojP7PxWjIVya2Bv5APhoOZxJODD5GkAIoYedJdeC9AwkajgyMixKSxbyRKKPVhPWCScfkFAatKx4ztdPoMnS004kNjDNrJ"
					token={makePayment}
					name={product.name}
					amount={product.price * 100} // Amount in cents
				>
					<button className="dash" id="dash" type="button">
						Pay Now
					</button>
				</StripeCheckout>
			</div>
		</div>
	);
};

export default Bookingpopup;
